import React, { useEffect, useState } from 'react'

function Home() {

  const [countries, setCountries] = useState([]);

  useEffect(() => {
    fetch('https://restcountries.com/v2/all')
      .then(res => res.json())
      .then(data => setCountries(data))
  }, []);

  console.log(countries)

  return (
      <div className="container">
        <h1>Home</h1>
      </div>
  )
}

export default Home
